import React from "react";

const TermsOfService = () => {
    return (
      <>
        <h1>Terms Of Service</h1>
        <p>
          This project is under a non-commercial Creative Commons license (CC BY-NC 4.0).
          For more information, visit <a href='https://creativecommons.org/licenses/by-nc/4.0/'>Creative Commons</a>.
        </p>
      </>
    );
  }

export default TermsOfService;
